package com.SamplePackage;

public class WhileNdoWhile {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a=5;
		while (a>=10) {
	 System.out.println(a);
	 a++;
 
		}
		System.out.println("==========");
		//Dowhile loop
		do {
			System.out.println(a);
		a++;
		} while (a>=10);


}
}
